import React, {Component} from 'react';

class DropdownCity extends Component {

constructor() {
  super()
  this.state = {
    location: [
      {
          id: 0,
          title: 'New York',
          selected: false,
          key: 'location'
      },
      {
        id: 1,
        title: 'Los Angeles',
        selected: false,
        key: 'location'
      },
      {
        id: 2,
        title: 'Philadelphia',
        selected: false,
        key: 'location'
      },
      {
        id: 3,
        title: 'Phoenix',
        selected: false,
        key: 'location'
      },
      {
        id: 4,
        title: 'Seattle',
        selected: false,
        key: 'location'
      },
      {
        id: 5,
        title: 'Miami',
        selected: false,
        key: 'location'
      }
    ]
  }
}



    render() {
        return (
      <div className="App">
        <p>Dropdown menu examples</p>

        <div className="wrapper">
          <DropdownMultiple
            titleHelper="Location"
            title="Select location"
            list={this.state.location}
            toggleItem={this.toggleSelected}
          />

          <Dropdown
            title="Select fruit"
            list={this.state.fruit}
            resetThenSet={this.resetThenSet}
          />
        </div>
      </div>
        );
    }
}

export default DropdownCity;
